-- 部门表
-- ----------------------------
CREATE TABLE "QDATA"."SYSTEM_DEPT"
(
    "DEPT_ID" BIGINT IDENTITY(852, 1) NOT NULL,
    "PARENT_ID" BIGINT DEFAULT 0,
    "ANCESTORS" VARCHAR(50) DEFAULT '',
    "DEPT_NAME" VARCHAR(30) DEFAULT '',
    "ORDER_NUM" INT DEFAULT 0,
    "LEADER" VARCHAR(20),
    "PHONE" VARCHAR(11),
    "EMAIL" VARCHAR(50),
    "STATUS" CHAR(1) DEFAULT '0',
    "DEL_FLAG" CHAR(1) DEFAULT '0',
    "CREATE_BY" VARCHAR(64) DEFAULT '',
    "CREATE_TIME" TIMESTAMP(0),
    "UPDATE_BY" VARCHAR(64) DEFAULT '',
    "UPDATE_TIME" TIMESTAMP(0),
    NOT CLUSTER PRIMARY KEY("DEPT_ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."SYSTEM_DEPT" IS '部门表';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."ANCESTORS" IS '祖级列表';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."CREATE_BY" IS '创建者';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."DEL_FLAG" IS '删除标志（0代表存在 2代表删除）';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."DEPT_ID" IS '部门id';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."DEPT_NAME" IS '部门名称';
COMMENT ON COLUMN "QDATA"."SYSTEM_DEPT"."EMAIL" IS '邮箱';
