-- ----------------------------
-- 字典类型表
-- ----------------------------
CREATE TABLE "QDATA"."SYSTEM_DICT_TYPE"
(
    "DICT_ID" BIGINT IDENTITY(25, 1) NOT NULL,
    "DICT_NAME" VARCHAR(100) DEFAULT '',
    "DICT_TYPE" VARCHAR(100) DEFAULT '',
    "STATUS" CHAR(1) DEFAULT '0',
    "CREATE_BY" VARCHAR(64) DEFAULT '',
    "CREATE_TIME" TIMESTAMP(0),
    "UPDATE_BY" VARCHAR(64) DEFAULT '',
    "UPDATE_TIME" TIMESTAMP(0),
    "REMARK" VARCHAR(500),
    NOT CLUSTER PRIMARY KEY("DICT_ID"),
    CONSTRAINT "DICT_TYPE" UNIQUE("DICT_TYPE")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."SYSTEM_DICT_TYPE" IS '字典类型表';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."CREATE_BY" IS '创建者';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."DICT_ID" IS '字典主键';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."DICT_NAME" IS '字典名称';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."DICT_TYPE" IS '字典类型';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."STATUS" IS '状态（0正常 1停用）';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."UPDATE_BY" IS '更新者';
COMMENT ON COLUMN "QDATA"."SYSTEM_DICT_TYPE"."UPDATE_TIME" IS '更新时间';

