CREATE TABLE "QDATA"."MESSAGE"
(
    "ID" INT IDENTITY(1, 1) NOT NULL,
    "SENDER_ID" BIGINT,
    "RECEIVER_ID" BIGINT,
    "TITLE" VARCHAR(128) NOT NULL,
    "CONTENT" VARCHAR(3072) NOT NULL,
    "CATEGORY" INT NOT NULL,
    "MSG_LEVEL" INT DEFAULT 0 NOT NULL,
    "MODULE" INT DEFAULT 0 NOT NULL,
    "ENTITY_TYPE" INT,
    "ENTITY_ID" BIGINT,
    "ENTITY_URL" VARCHAR(256),
    "HAS_READ" TINYINT DEFAULT 0,
    "HAS_RETRACTION" TINYINT DEFAULT 0,
    "VALID_FLAG" TINYINT DEFAULT 1 NOT NULL,
    "DEL_FLAG" TINYINT DEFAULT 0 NOT NULL,
    "CREATE_BY" VARCHAR(32),
    "CREATOR_ID" BIGINT,
    "CREATE_TIME" TIMESTAMP(0),
    "UPDATE_BY" VARCHAR(32),
    "UPDATE_TIME" TIMESTAMP(0),
    "UPDATER_ID" BIGINT,
    "REMARK" VARCHAR(512),
    NOT CLUSTER PRIMARY KEY("ID"),
    CHECK("CATEGORY" >= 0)
    ,CHECK("ENTITY_TYPE" >= 0)
    ,CHECK("MODULE" >= 0)
    ,CHECK("MSG_LEVEL" >= 0)) STORAGE(ON "MAIN", CLUSTERBTR) ;

