atasource":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_OPEN\",\"password\":\"123456\",\"dbname\":\"QDATA_OPEN\"}","ip":"110.42.38.62","port":40013,"dbname":"QDATA","target_asset_id":48,"datasourceId":48},"toColumnsList":[{"columnName":"SCHED_NAME","columnComment":"调度名称","columnType":"VARCHAR","columnLength":120,"columnScale":0,"nullableFlag":"0","pkFlag":"1","isChecked":true},{"columnName":"ENTRY_ID","columnComment":"调度器实例id","columnType":"VARCHAR","columnLength":95,"columnScale":0,"nullableFlag":"0","pkFlag":"1","isChecked":true},{"columnName":"TRIGGER_NAME","columnComment":"qrtz_triggers表trigger_name的外键","columnType":"VARCHAR","columnLength":200,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"TRIGGER_GROUP","columnComment":"qrtz_triggers表trigger_group的外键","columnType":"VARCHAR","columnLength":200,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"INSTANCE_NAME","columnComment":"调度器实例名","columnType":"VARCHAR","columnLength":200,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"FIRED_TIME","columnComment":"触发的时间","columnType":"BIGINT","columnLength":8,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"SCHED_TIME","columnComment":"定时器制定的时间","columnType":"BIGINT","columnLength":8,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"PRIORITY","columnComment":"优先级","columnType":"INT","columnLength":4,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"STATE","columnComment":"状态","columnType":"VARCHAR","columnLength":16,"columnScale":0,"nullableFlag":"0","pkFlag":"0","isChecked":true},{"columnName":"JOB_NAME","columnComment":"任务名称","columnType":"VARCHAR","columnLength":200,"columnScale":0,"nullableFlag":"1","pkFlag":"0","isChecked":true},{"columnName":"JOB_GROUP","columnComment":"任务组名","columnType":"VARCHAR","columnLength":200,"columnScale":0,"nullableFlag":"1","pkFlag":"0","isChecked":true},{"columnName":"IS_NONCONCURRENT","columnComment":"是否并发","columnType":"VARCHAR","columnLength":1,"columnScale":0,"nullableFlag":"1","pkFlag":"0","isChecked":true},{"columnName":"REQUESTS_RECOVERY","columnComment":"是否接受恢复执行","columnType":"VARCHAR","columnLength":1,"columnScale":0,"nullableFlag":"1","pkFlag":"0","isChecked":true}],"target_datasource_id":"","datasourceId":"","where":"","batchSize":"1024","config":"","writeModeType":2,"preSql":""}','MEDIUM',0,1,0,0,-1,-1,NULL,NULL,'1','0','qData',1,'2025-05-24 10:44:04.471000','qData',1,'2025-05-24 10:44:04.471000',NULL,'91');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1262,'3','PROCEDURE','小山口数据开发','141951009362784',3,84,'141883958809440','{"sqlType":"2","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_OPEN\",\"password\":\"123456\",\"dbname\":\"QDATA_OPEN\"}","ip":"110.42.38.62","port":40013,"dbname":"QDATA","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[],"sql":"SELECT \n    s.small_mouth_id,\n    s.mouth_name,\n    s.elevation,\n    s.geo_coordinates,\n    s.watershed_area,\n    s.average_annual_flow,\n    b.basin_name,\n    r.river_name,\n    LISTAGG(w.weather_type, '', '') WITHIN GROUP (ORDER BY w.record_date DESC) AS recent_weather_conditions,\n    AVG(h.water_level) AS avg_water_level,\n    MAX(h.water_level) AS max_water_level\nFROM \n    small_mouths s\nJOIN \n    river_basins b ON s.basin_id = b.basin_id\nJOIN \n    rivers r ON s.river_id = r.river_id\nLEFT JOIN \n    hydrological_data h ON s.small_mouth_id = h.location_id AND h.data_type = ''small_mouth''\nLEFT JOIN \n    weather_records w ON s.small_mouth_id = w.location_id \n        AND w.record_date BETWEEN ADD_MONTHS(SYSDATE, -3) AND SYSDATE\nGROUP BY \n    s.small_mouth_id, s.mouth_name, s.elevation, s.geo_coordinates, \n    s.watershed_area, s.average_annual_flow, b.basin_name, r.river_name\nHAVING \n    AVG(h.water_level) > 5 OR MAX(h.water_level) > 8\nORDER BY \n    s.watershed_area DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',554,'1','0','管理员',1,'2025-06-11 21:55:43.037000','管理员',1,'2025-06-11 21:55:43.037000',NULL,'52');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1263,'3','SQL','泵站数据开发','143585058469728',1,84,'141883958809440','{"sqlType":"0","type":"DM8","sql":"SELECT \n    p.pump_station_id,\n    p.station_name,\n    p.location,\n    p.installed_capacity,\n    p.design_lift,\n    p.annual_pumping_volume,\n    p.commissioning_date,\n    DATEDIFF(YEAR, p.commissioning_date, CURRENT_DATE) AS years_in_operation,\n    i.intake_name,\n    r.reservoir_name,\n    (SELECT COUNT(m.maintenance_id) \n     FROM pump_maintenance m \n     WHERE m.pump_station_id = p.pump_station_id \n     AND m.maintenance_date > ADD_MONTHS(CURRENT_DATE, -12)) AS annual_maintenance_count,\n    (SELECT SUM(e.energy_consumption) \n     FROM pump_energy_usage e \n     WHERE e.pump_station_id = p.pump_station_id \n     AND EXTRACT(YEAR FROM e.usage_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS annual_energy_consumption\nFROM \n    pump_stations p\nLEFT JOIN \n    water_intakes i ON p.intake_id = i.intake_id\nLEFT JOIN \n    reservoirs r ON p.reservoir_id = r.reservoir_id\nWHERE \n    p.status = ''operational''\n    AND p.installed_capacity > 1000\n    AND p.commissioning_date < ADD_MONTHS(CURRENT_DATE, -60)\nORDER BY \n    annual_energy_consumption DESC NULLS LAST, \n    years_in_operation DESC;","typaCode":"DM","localParams":[],"datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_TEST\",\"password\":\"123456\",\"dbname\":\"QDATA_TEST\"}","ip":"127.0.0.1","port":5236,"dbname":"QDATA_TEST","datasource_id":48,"datasourceId":48}}','MEDIUM',0,0,0,0,-1,-1,'',567,'1','0','管理员',1,'2025-06-11 21:56:24.764000','管理员',1,'2025-06-11 21:56:24.764000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1265,'3','SQL','水库基本信息数据开发','143585127993184',1,84,'141883958809440','{"sqlType":"0","type":"DM8","sql":"WITH reservoir_stats AS (\n    SELECT \n        r.reservoir_id,\n        r.reservoir_name,\n        r.total_capacity,\n        r.normal_water_level,\n        r.dead_storage_level,\n        r.watershed_area,\n        b.basin_name,\n        r.completion_year,\n        (SELECT AVG(s.storage) \n         FROM reservoir_storage s \n         WHERE s.reservoir_id = r.reservoir_id\n         AND EXTRACT(YEAR FROM s.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_avg_storage,\n        (SELECT MAX(s.storage) \n         FROM reservoir_storage s \n         WHERE s.reservoir_id = r.reservoir_id) AS historical_max_storage,\n        (SELECT MIN(s.storage) \n         FROM reservoir_storage s \n         WHERE s.reservoir_id = r.reservoir_id) AS historical_min_storage\n    FROM \n        reservoirs r\n    JOIN \n        river_basins b ON r.basin_id = b.basin_id\n    WHERE \n        r.status = ''operational''\n)\nSELECT \n    rs.*,\n    rs.current_year_avg_storage / rs.total_capacity * 100 AS current_year_utilization_rate,\n    (SELECT COUNT(*) \n     FROM dam_safety_inspections d \n     WHERE d.reservoir_id = rs.reservoir_id\n     AND d.inspection_date > ADD_MONTHS(CURRENT_DATE, -12)) AS annual_inspections,\n    (SELECT SUM(r.release_volume) \n     FROM reservoir_releases r \n     WHERE r.reservoir_id = rs.reservoir_id\n     AND EXTRACT(YEAR FROM r.release_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS annual_release_volume\nFROM \n    reservoir_stats rs\nWHERE \n    rs.current_year_avg_storage IS NOT NULL\n    AND rs.total_capacity > 10000000\nORDER BY \n    rs.total_capacity DESC,\n    current_year_utilization_rate DESC;","typaCode":"DM","localParams":[],"datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_TEST\",\"password\":\"123456\",\"dbname\":\"QDATA_TEST\"}","ip":"127.0.0.1","port":5236,"dbname":"QDATA_TEST","datasource_id":48,"datasourceId":48}}','MEDIUM',0,0,0,0,-1,-1,'',569,'1','0','管理员',1,'2025-06-11 21:57:31.931000','管理员',1,'2025-06-11 21:57:31.931000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1266,'3','SQL','水闸数据开发','143585088345952',2,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_TEST\",\"password\":\"123456\",\"dbname\":\"QDATA_TEST\"}","ip":"127.0.0.1","port":5236,"dbname":"QDATA_TEST","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[],"sql":"SELECT \n    g.gate_id,\n    g.gate_name,\n    g.location,\n    g.gate_type,\n    g.design_flow_capacity,\n    g.max_opening_height,\n    r.river_name,\n    b.basin_name,\n    (SELECT MAX(h.water_level) \n     FROM hydrological_data h \n     WHERE h.location_id = g.gate_id \n     AND h.data_type = ''gate''\n     AND h.record_date BETWEEN ADD_MONTHS(CURRENT_DATE, -12) AND CURRENT_DATE) AS max_water_level_12m,\n    (SELECT COUNT(o.operation_id) \n     FROM gate_operations o \n     WHERE o.gate_id = g.gate_id\n     AND o.operation_date BETWEEN ADD_MONTHS(CURRENT_DATE, -3) AND CURRENT_DATE) AS recent_operations,\n    (SELECT AVG(o.opening_percentage) \n     FROM gate_operations o \n     WHERE o.gate_id = g.gate_id\n     AND o.operation_date BETWEEN ADD_MONTHS(CURRENT_DATE, -3) AND CURRENT_DATE) AS avg_opening_percentage\nFROM \n    water_gates g\nJOIN \n    rivers r ON g.river_id = r.river_id\nJOIN \n    river_basins b ON r.basin_id = b.basin_id\nWHERE \n    g.status = ''active''\n    AND g.design_flow_capacity > 500\nORDER BY \n    g.design_flow_capacity DESC,\n    recent_operations DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',568,'1','0','管理员',1,'2025-06-11 21:57:50.668000','管理员',1,'2025-06-11 21:57:50.668000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1269,'3','SQL','雨量站数据开发','143585176487776',3,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_TEST\",\"password\":\"123456\",\"dbname\":\"QDATA_TEST\"}","ip":"127.0.0.1","port":5236,"dbname":"QDATA_TEST","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[],"sql":"SELECT \n    r.rainfall_station_id,\n    r.station_name,\n    r.location,\n    r.elevation,\n    r.installation_date,\n    b.basin_name,\n    c.county_name,\n    p.province_name,\n    (SELECT AVG(rd.rainfall) \n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_avg_rainfall,\n    (SELECT MAX(rd.rainfall) \n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_max_rainfall,\n    (SELECT PERCENTILE_CONT(0.9) WITHIN GROUP (ORDER BY rd.rainfall)\n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_90th_percentile,\n    (SELECT COUNT(*) \n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND rd.rainfall > 50\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS heavy_rain_days\nFROM \n    rainfall_stations r\nJOIN \n    river_basins b ON r.basin_id = b.basin_id\nLEFT JOIN \n    counties c ON r.county_id = c.county_id\nLEFT JOIN \n    provinces p ON c.province_id = p.province_id\nWHERE \n    r.status = ''active''\n    AND r.installation_date < ADD_MONTHS(CURRENT_DATE, -60)\nORDER BY \n    current_year_avg_rainfall DESC,\n    heavy_rain_days DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',570,'1','0','管理员',1,'2025-06-11 21:58:56.249000','管理员',1,'2025-06-11 21:58:56.249000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1270,'3','SQL','取水口基础信息数据开发','141950767490912',4,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_OPEN\",\"password\":\"123456\",\"dbname\":\"QDATA_OPEN\"}","ip":"110.42.38.62","port":40013,"dbname":"QDATA","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[],"sql":"SELECT \n    w.intake_id,\n    w.intake_name,\n    w.location,\n    w.design_capacity,\n    w.current_capacity,\n    w.water_source_type,\n    w.construction_date,\n    b.basin_name,\n    r.river_name,\n    COUNT(o.operation_id) AS operation_count\nFROM \n    water_intakes w\nJOIN \n    river_basins b ON w.basin_id = b.basin_id\nLEFT JOIN \n    rivers r ON w.river_id = r.river_id\nLEFT JOIN \n    intake_operations o ON w.intake_id = o.intake_id\nWHERE \n    w.status = ''active''\n    AND w.design_capacity > 10\n    AND w.construction_date BETWEEN TO_DATE(''2010-01-01'', ''YYYY-MM-DD'') AND SYSDATE\nGROUP BY \n    w.intake_id, w.intake_name, w.location, w.design_capacity, \n    w.current_capacity, w.water_source_type, w.construction_date,\n    b.basin_name, r.river_name\nHAVING \n    COUNT(o.operation_id) > 5\nORDER BY \n    w.current_capacity DESC, operation_count DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',552,'1','0','管理员',1,'2025-06-11 22:10:50.905000','管理员',1,'2025-06-11 22:10:50.905000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (1271,'3','SQL','灌区相关的数据开发','141950875765600',4,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_OPEN\",\"password\":\"123456\",\"dbname\":\"QDATA_OPEN\"}","ip":"110.42.38.62","port":40013,"dbname":"QDATA","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[{"prop":"id","type":"TINYINT","value":"1","direct":"IN"}],"sql":"WITH irrigated_areas AS (\n    SELECT \n        i.area_id,\n        i.area_name,\n        i.total_area,\n        i.effective_irrigated_area,\n        i.water_source,\n        i.annual_water_usage,\n        c.county_name,\n        p.province_name,\n        RANK() OVER (PARTITION BY p.province_name ORDER BY i.effective_irrigated_area DESC) AS area_rank\n    FROM \n        irrigation_areas i\n    JOIN \n        counties c ON i.county_id = c.county_id\n    JOIN \n        provinces p ON c.province_id = p.province_id\n    WHERE \n        i.status = ''operational''\n        AND i.effective_irrigated_area > 5000\n)\nSELECT \n    a.*,\n    (SELECT COUNT(*) FROM irrigation_crops ic WHERE ic.area_id = a.area_id) AS crop_types,\n    (SELECT SUM(ic.area) FROM irrigation_crops ic WHERE ic.area_id = a.area_id) AS total_crop_area,\n    ROUND(a.effective_irrigated_area / a.total_area * 100, 2) AS efficiency_rate\nFROM \n    irrigated_areas a\nWHERE \n    a.area_rank <= 10\nORDER BY \n    a.province_name, a.area_rank;"}','MEDIUM',0,0,0,0,-1,-1,'',553,'1','0','管理员',1,'2025-06-11 22:11:08.613000','管理员',1,'2025-06-11 22:11:08.613000',NULL,'51');
