CREATE TABLE "QDATA"."DPP_ETL_NODE_INSTANCE"
(
"ID" BIGINT NOT NULL,
"TASK_TYPE" VARCHAR2(10) DEFAULT '1' NOT NULL,
"NAME" VARCHAR2(128) NOT NULL,
"NODE_TYPE" VARCHAR2(32) NOT NULL,
"NODE_ID" BIGINT NOT NULL,
