CREATE TABLE "QDATA"."DPP_ETL_NODE_LOG"
(
"ID" BIGINT IDENTITY(284, 1) NOT NULL,
"TASK_TYPE" VARCHAR2(10) DEFAULT '1' NOT NULL,
"TYPE" VARCHAR2(32) NOT NULL,
"NAME" VARCHAR2(128) NOT NULL,
"CODE" VARCHAR2(32) NOT NULL,
