"TIMEOUT" INTEGER DEFAULT 0,
"DELAY_TIME" INTEGER DEFAULT 0,
"CPU_QUOTA" INTEGER DEFAULT '-1',
"MEMORY_MAX" INTEGER DEFAULT '-1',
"DESCRIPTION" VARCHAR2(512),
"DS_ID" BIGINT,
"VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
"CREATE_BY" VARCHAR2(32),
"CREATOR_ID" BIGINT,
"CREATE_TIME" DATETIME(6),
"UPDATE_BY" VARCHAR2(32),
"UPDATER_ID" BIGINT,
"UPDATE_TIME" DATETIME(6),
"REMARK" VARCHAR2(512),
"COMPONENT_TYPE" VARCHAR(10) DEFAULT '1' NOT NULL,
