_id\nWHERE \n    r.status = ''active''\n    AND r.installation_date < ADD_MONTHS(CURRENT_DATE, -60)\nORDER BY \n    current_year_avg_rainfall DESC,\n    heavy_rain_days DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',570,'1','0','管理员',1,'2025-06-11 21:58:42.891000','管理员',1,'2025-06-11 21:58:42.891000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE_LOG (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (296,'3','SQL','雨量站数据开发','143585176487776',3,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_TEST\",\"password\":\"123456\",\"dbname\":\"QDATA_TEST\"}","ip":"127.0.0.1","port":5236,"dbname":"QDATA_TEST","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[],"sql":"SELECT \n    r.rainfall_station_id,\n    r.station_name,\n    r.location,\n    r.elevation,\n    r.installation_date,\n    b.basin_name,\n    c.county_name,\n    p.province_name,\n    (SELECT AVG(rd.rainfall) \n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_avg_rainfall,\n    (SELECT MAX(rd.rainfall) \n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_max_rainfall,\n    (SELECT PERCENTILE_CONT(0.9) WITHIN GROUP (ORDER BY rd.rainfall)\n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS current_year_90th_percentile,\n    (SELECT COUNT(*) \n     FROM rainfall_data rd \n     WHERE rd.station_id = r.rainfall_station_id\n     AND rd.rainfall > 50\n     AND EXTRACT(YEAR FROM rd.record_date) = EXTRACT(YEAR FROM CURRENT_DATE)) AS heavy_rain_days\nFROM \n    rainfall_stations r\nJOIN \n    river_basins b ON r.basin_id = b.basin_id\nLEFT JOIN \n    counties c ON r.county_id = c.county_id\nLEFT JOIN \n    provinces p ON c.province_id = p.province_id\nWHERE \n    r.status = ''active''\n    AND r.installation_date < ADD_MONTHS(CURRENT_DATE, -60)\nORDER BY \n    current_year_avg_rainfall DESC,\n    heavy_rain_days DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',570,'1','0','管理员',1,'2025-06-11 21:58:56.785000','管理员',1,'2025-06-11 21:58:56.785000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE_LOG (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (297,'3','SQL','取水口基础信息数据开发','141950767490912',4,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_OPEN\",\"password\":\"123456\",\"dbname\":\"QDATA_OPEN\"}","ip":"110.42.38.62","port":40013,"dbname":"QDATA","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[],"sql":"SELECT \n    w.intake_id,\n    w.intake_name,\n    w.location,\n    w.design_capacity,\n    w.current_capacity,\n    w.water_source_type,\n    w.construction_date,\n    b.basin_name,\n    r.river_name,\n    COUNT(o.operation_id) AS operation_count\nFROM \n    water_intakes w\nJOIN \n    river_basins b ON w.basin_id = b.basin_id\nLEFT JOIN \n    rivers r ON w.river_id = r.river_id\nLEFT JOIN \n    intake_operations o ON w.intake_id = o.intake_id\nWHERE \n    w.status = ''active''\n    AND w.design_capacity > 10\n    AND w.construction_date BETWEEN TO_DATE(''2010-01-01'', ''YYYY-MM-DD'') AND SYSDATE\nGROUP BY \n    w.intake_id, w.intake_name, w.location, w.design_capacity, \n    w.current_capacity, w.water_source_type, w.construction_date,\n    b.basin_name, r.river_name\nHAVING \n    COUNT(o.operation_id) > 5\nORDER BY \n    w.current_capacity DESC, operation_count DESC;"}','MEDIUM',0,0,0,0,-1,-1,'',552,'1','0','管理员',1,'2025-06-11 22:10:51.462000','管理员',1,'2025-06-11 22:10:51.462000',NULL,'51');
INSERT INTO "QDATA".DPP_ETL_NODE_LOG (ID,TASK_TYPE,"TYPE",NAME,CODE,VERSION,PROJECT_ID,PROJECT_CODE,PARAMETERS,PRIORITY,FAIL_RETRY_TIMES,FAIL_RETRY_INTERVAL,TIMEOUT,DELAY_TIME,CPU_QUOTA,MEMORY_MAX,DESCRIPTION,DS_ID,VALID_FLAG,DEL_FLAG,CREATE_BY,CREATOR_ID,CREATE_TIME,UPDATE_BY,UPDATER_ID,UPDATE_TIME,REMARK,COMPONENT_TYPE) VALUES (298,'3','SQL','灌区相关的数据开发','141950875765600',4,84,'141883958809440','{"sqlType":"0","typaCode":"DM","datasources":{"datasourceType":"DM8","datasourceConfig":"{\"username\":\"QDATA_OPEN\",\"password\":\"123456\",\"dbname\":\"QDATA_OPEN\"}","ip":"110.42.38.62","port":40013,"dbname":"QDATA","datasource_id":48,"datasourceId":48},"type":"DM8","localParams":[{"prop":"id","type":"TINYINT","value":"1","direct":"IN"}],"sql":"WITH irrigated_areas AS (\n    SELECT \n        i.area_id,\n        i.area_name,\n        i.total_area,\n        i.effective_irrigated_area,\n        i.water_source,\n        i.annual_water_usage,\n        c.county_name,\n        p.province_name,\n        RANK() OVER (PARTITION BY p.province_name ORDER BY i.effective_irrigated_area DESC) AS area_rank\n    FROM \n        irrigation_areas i\n    JOIN \n        counties c ON i.county_id = c.county_id\n    JOIN \n        provinces p ON c.province_id = p.province_id\n    WHERE \n        i.status = ''operational''\n        AND i.effective_irrigated_area > 5000\n)\nSELECT \n    a.*,\n    (SELECT COUNT(*) FROM irrigation_crops ic WHERE ic.area_id = a.area_id) AS crop_types,\n    (SELECT SUM(ic.area) FROM irrigation_crops ic WHERE ic.area_id = a.area_id) AS total_crop_area,\n    ROUND(a.effective_irrigated_area / a.total_area * 100, 2) AS efficiency_rate\nFROM \n    irrigated_areas a\nWHERE \n    a.area_rank <= 10\nORDER BY \n    a.province_name, a.area_rank;"}','MEDIUM',0,0,0,0,-1,-1,'',553,'1','0','管理员',1,'2025-06-11 22:11:09.204000','管理员',1,'2025-06-11 22:11:09.204000',NULL,'51');
SET IDENTITY_INSERT "QDATA"."DPP_ETL_NODE_LOG" OFF;


-- ----------------------------
-- 数据集成调度信息
-- ----------------------------
CREATE TABLE "QDATA"."DPP_ETL_SCHEDULER"
(
"ID" BIGINT IDENTITY(1, 1) NOT NULL,
"TASK_ID" BIGINT NOT NULL,
"TASK_CODE" VARCHAR2(32) NOT NULL,
"START_TIME" DATETIME(6),
"END_TIME" DATETIME(6),
"TIMEZONE_ID" VARCHAR2(128) DEFAULT 'Asia/Shanghai' NOT NULL,
"CRON_EXPRESSION" VARCHAR2(255) NOT NULL,
"FAILURE_STRATEGY" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DS_ID" BIGINT NOT NULL,
"VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
"CREATE_BY" VARCHAR2(32),
"CREATOR_ID" BIGINT,
"CREATE_TIME" DATETIME(6),
"UPDATE_BY" VARCHAR2(32),
"UPDATER_ID" BIGINT,
"UPDATE_TIME" DATETIME(6),
"REMARK" VARCHAR2(512),
"STATUS" VARCHAR2(10) DEFAULT '-1' NOT NULL,
NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DPP_ETL_SCHEDULER" IS '数据集成调度信息';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."CRON_EXPRESSION" IS 'cron表达式';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."DS_ID" IS 'DolphinScheduler的id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."END_TIME" IS '结束时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."FAILURE_STRATEGY" IS '失败策略;是否继续 0:否 1:是';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."START_TIME" IS '开始时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."STATUS" IS '调度状态;-1:草稿，0:未上线，1:已上线';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."TASK_CODE" IS '任务编码;DolphinScheduler任务的编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."TASK_ID" IS '任务id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."TIMEZONE_ID" IS '时区;直接默认 Asia/Shanghai';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_SCHEDULER"."VALID_FLAG" IS '是否有效;0：无效，1：有效';

