-- ----------------------------
-- 数据集成任务
-- ----------------------------
CREATE TABLE "QDATA"."DPP_ETL_TASK"
(
"ID" BIGINT IDENTITY(249, 1) NOT NULL,
"CAT_ID" BIGINT,
"CAT_CODE" VARCHAR2(32),
"TYPE" VARCHAR2(10) NOT NULL,
"NAME" VARCHAR2(128) NOT NULL,
"CODE" VARCHAR2(128) NOT NULL,
"VERSION" INTEGER DEFAULT 1 NOT NULL,
"PROJECT_ID" BIGINT NOT NULL,
"PROJECT_CODE" VARCHAR2(32) NOT NULL,
"PERSON_CHARGE" VARCHAR2(32) NOT NULL,
"CONTACT_NUMBER" VARCHAR2(32),
"LOCATIONS" TEXT,
"DESCRIPTION" VARCHAR2(512),
"TIMEOUT" INTEGER DEFAULT 0 NOT NULL,
"EXTRACTION_COUNT" INTEGER,
"WRITE_COUNT" INTEGER,
"EXECUTION_TYPE" VARCHAR2(32) NOT NULL,
"STATUS" VARCHAR2(10) DEFAULT '-1' NOT NULL,
"DS_ID" BIGINT NOT NULL,
"VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
"CREATE_BY" VARCHAR2(32),
"CREATOR_ID" BIGINT,
"CREATE_TIME" DATETIME(6),
"UPDATE_BY" VARCHAR2(32),
"UPDATER_ID" BIGINT,
"UPDATE_TIME" DATETIME(6),
"REMARK" VARCHAR2(512),
"ETL_NODE_CODE" VARCHAR2(128),
NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DPP_ETL_TASK" IS '数据集成任务';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CAT_CODE" IS '类目编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CAT_ID" IS '类目id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CODE" IS '任务编码;DolphinScheduler中的编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CONTACT_NUMBER" IS '联系电话';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."DESCRIPTION" IS '描述';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."DS_ID" IS 'DolphinScheduler的id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."ETL_NODE_CODE" IS 'ETL在调度器中的节点编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."EXECUTION_TYPE" IS '执行策略;任务的执行策略：PARALLEL (并行)、SERIAL_WAIT (串行等待)、SERIAL_DISCARD (串行抛弃)、SERIAL_PRIORITY (串行优先)';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."EXTRACTION_COUNT" IS '抽取量';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."LOCATIONS" IS '节点坐标信息';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."NAME" IS '任务名称';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."PERSON_CHARGE" IS '责任人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."PROJECT_CODE" IS '项目编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."PROJECT_ID" IS '项目id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."STATUS" IS '任务状态;-1:草稿，0:未上线，1:已上线';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."TIMEOUT" IS '超时时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."TYPE" IS '任务类型;1：离线任务 2：实时任务 3：数据开发任务 4：	作业任务';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."VALID_FLAG" IS '是否有效;0：无效，1：有效';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."VERSION" IS '任务版本';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK"."WRITE_COUNT" IS '写入量';

