COMMENT ON TABLE "QDATA"."DPP_ETL_TASK_INSTANCE" IS '数据集成任务实例';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."CAT_CODE" IS '类目编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."CAT_ID" IS '类目id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."COMMAND_TYPE" IS '运行类型;0 启动工作流,1 从当前节点开始执行,2 恢复被容错的工作流,3 恢复暂停流程,4 从失败节点开始执行,5 补数,6 调度,7 重跑,8 暂停,9 停止,10 恢复等待线程';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."CONTACT_NUMBER" IS '联系电话';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."DS_ID" IS 'DolphinScheduler的id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."END_TIME" IS '结束时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."FAILURE_STRATEGY" IS '失败策略;0 失败后结束，1 失败后继续';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."MAX_TRY_TIMES" IS '最大重试次数';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."NAME" IS '任务实例名称;任务名称_任务版本_时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."PARENT_NODE_INSTANCE_ID" IS '父任务节点实例id;只有为子任务时才有该值';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."PARENT_TASK_INSTANCE_ID" IS '父任务实例id;只有为子任务时才有该值';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."PERSON_CHARGE" IS '责任人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."PROJECT_CODE" IS '项目编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."PROJECT_ID" IS '项目id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."RUN_TIMES" IS '运行次数';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."SCHEDULE_TIME" IS '调度时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."START_TIME" IS '开始时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."STATUS" IS '状态;0：提交成功 1：正在执行 2:准备暂停 3：暂停 4：准备停止 5：停止 6：失败 7：成功 12：延时执行  14：串行等待  15 ：准备锁定 16：锁定';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."STATUS_HISTORY" IS '状态历史(json列表)';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."SUB_TASK_FLAG" IS '是否是子任务;0:不是 ，1:是';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."TASK_CODE" IS '任务编码;DolphinScheduler中的编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."TASK_ID" IS '任务id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."TASK_TYPE" IS '任务类型;1：离线任务 2：实时任务 3：数据开发任务 4：	作业任务';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."TASK_VERSION" IS '任务版本';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_INSTANCE"."VALID_FLAG" IS '是否有效;0：无效，1：有效';

