-- ----------------------------
-- 数据集成任务-日志表
-- ----------------------------
CREATE TABLE "QDATA"."DPP_ETL_TASK_LOG"
(
"ID" BIGINT IDENTITY(520, 1) NOT NULL,
"TYPE" VARCHAR2(10) DEFAULT '1' NOT NULL,
"NAME" VARCHAR2(128) NOT NULL,
"CODE" VARCHAR2(128) NOT NULL,
"VERSION" INTEGER DEFAULT 1 NOT NULL,
"PROJECT_ID" BIGINT NOT NULL,
"PROJECT_CODE" VARCHAR2(32) NOT NULL,
"PERSON_CHARGE" VARCHAR2(32) NOT NULL,
"CONTACT_NUMBER" VARCHAR2(32),
"LOCATIONS" TEXT,
"DESCRIPTION" VARCHAR2(512),
"TIMEOUT" INTEGER DEFAULT 0 NOT NULL,
"EXTRACTION_COUNT" INTEGER,
"WRITE_COUNT" INTEGER,
"EXECUTION_TYPE" VARCHAR2(32),
"STATUS" VARCHAR2(10) DEFAULT '-1' NOT NULL,
"DS_ID" BIGINT NOT NULL,
"VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
"CREATE_BY" VARCHAR2(32),
"CREATOR_ID" BIGINT,
"CREATE_TIME" DATETIME(6),
"UPDATE_BY" VARCHAR2(32),
"UPDATER_ID" BIGINT,
"UPDATE_TIME" DATETIME(6),
"REMARK" VARCHAR2(512),
NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DPP_ETL_TASK_LOG" IS '数据集成任务-日志表';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."CODE" IS '任务编码;DolphinScheduler中的编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."CONTACT_NUMBER" IS '联系电话';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."DESCRIPTION" IS '描述';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."DS_ID" IS 'DolphinScheduler的id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."EXECUTION_TYPE" IS '任务的执行策略;：PARALLEL (并行)、SERIAL_WAIT (串行等待)、SERIAL_DISCARD (串行抛弃)、SERIAL_PRIORITY (串行优先)';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."EXTRACTION_COUNT" IS '抽取量';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."LOCATIONS" IS '节点坐标信息';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."NAME" IS '任务名称';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."PERSON_CHARGE" IS '责任人';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."PROJECT_CODE" IS '项目编码';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."PROJECT_ID" IS '项目id';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."STATUS" IS '任务状态;-1:草稿，0:未上线，1:已上线';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."TIMEOUT" IS '超时时间';
COMMENT ON COLUMN "QDATA"."DPP_ETL_TASK_LOG"."TYPE" IS '任务类型;1：离线任务 2：实时任务 3：数据开发任务 4：	作业任务';
