CREATE TABLE "QDATA"."DS_API_LOG"
(
"ID" BIGINT IDENTITY(1, 1) NOT NULL,
"API_ID" BIGINT NOT NULL,
"CALLER_ID" VARCHAR2(256) NOT NULL,
"CALLER_BY" VARCHAR2(50) NOT NULL,
"CALLER_IP" VARCHAR2(128) NOT NULL,
"CALLER_URL" VARCHAR2(1024) NOT NULL,
"CALLER_PARAMS" TEXT,
"CALLER_START_DATE" DATETIME(6) DEFAULT CURRENT_TIMESTAMP NOT NULL,
"CALLER_END_DATE" DATETIME(6),
"CALLER_SIZE" INTEGER DEFAULT 0,
"CALLER_TIME" INTEGER DEFAULT 0,
"MSG" TEXT,
"STATUS" CHAR(1) DEFAULT 1 NOT NULL,
"VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
"CREATE_BY" VARCHAR2(32),
"CREATOR_ID" BIGINT,
"CREATE_TIME" DATETIME(6),
"UPDATE_BY" VARCHAR2(32),
"UPDATER_ID" BIGINT,
"UPDATE_TIME" DATETIME(6),
"REMARK" VARCHAR2(512),
"FIELD_PARAMETERS" TEXT,
"CAT_ID" BIGINT NOT NULL,
"CAT_CODE" VARCHAR(256) NOT NULL,
NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

