-- ----------------------------
-- 数据服务类目管理
-- ----------------------------
CREATE TABLE "QDATA"."ATT_API_CAT"
(
    "ID" BIGINT IDENTITY(65, 1) NOT NULL,
    "NAME" VARCHAR2(128) NOT NULL,
    "PARENT_ID" BIGINT,
    "SORT_ORDER" INTEGER DEFAULT 0 NOT NULL,
    "DESCRIPTION" VARCHAR2(512),
    "CODE" VARCHAR2(128) NOT NULL,
    "VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
    "DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
    "CREATE_BY" VARCHAR2(32),
    "CREATOR_ID" BIGINT,
    "CREATE_TIME" DATETIME(6),
    "UPDATE_BY" VARCHAR2(32),
    "UPDATER_ID" BIGINT,
    "UPDATE_TIME" DATETIME(6),
    "REMARK" VARCHAR2(512),
    NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."ATT_API_CAT" IS '数据服务类目管理';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."CODE" IS '层级编码';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."DESCRIPTION" IS '描述';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."NAME" IS '类别名称';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."PARENT_ID" IS '关联上级ID';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."SORT_ORDER" IS '类别排序';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."ATT_API_CAT"."VALID_FLAG" IS '是否有效;0：无效，1：有效';

SET IDENTITY_INSERT "QDATA"."ATT_API_CAT" ON;
