CREATE TABLE "QDATA"."AUTH_CLIENT"
(
    "ID" INT IDENTITY(39, 1) NOT NULL,
    "SECRET_KEY" VARCHAR(256) NOT NULL,
    "NAME" VARCHAR(128) NOT NULL,
    "TYPE" INT NOT NULL,
    "ICON" VARCHAR(256),
    "HOME_URL" VARCHAR(256),
    "SYNC_URL" VARCHAR(256),
    "REDIRECT_URL" VARCHAR(1024) NOT NULL,
    "PUBLIC_FLAG" TINYINT DEFAULT 1 NOT NULL,
    "VALID_FLAG" TINYINT DEFAULT 1 NOT NULL,
    "DEL_FLAG" TINYINT DEFAULT 0 NOT NULL,
    "CREATE_BY" VARCHAR(128),
    "CREATOR_ID" BIGINT,
    "CREATE_TIME" TIMESTAMP(0),
    "UPDATE_BY" VARCHAR(128),
    "UPDATER_ID" VARCHAR(20),
    "UPDATE_TIME" TIMESTAMP(0),
    "REMARK" VARCHAR(512),
    NOT CLUSTER PRIMARY KEY("ID"),
    CHECK("TYPE" >= 0)) STORAGE(ON "MAIN", CLUSTERBTR) ;

