-- ----------------------------
-- 数据资产-视频数据表
-- ----------------------------
CREATE TABLE "QDATA"."DA_ASSET_VIDEO"
(
    "ID" BIGINT IDENTITY(3, 1) NOT NULL,
    "ASSET_ID" BIGINT NOT NULL,
    "IP" VARCHAR2(32) NOT NULL,
    "PORT" INTEGER NOT NULL,
    "PROTOCOL" VARCHAR2(32) NOT NULL,
    "PLATFORM" CHAR(1) DEFAULT 1 NOT NULL,
    "CONFIG" VARCHAR2(512) NOT NULL,
    "STATUS" CHAR(1) DEFAULT 1 NOT NULL,
    "VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
    "DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
    "CREATE_BY" VARCHAR2(32),
    "CREATOR_ID" BIGINT,
    "CREATE_TIME" DATETIME(6),
    "UPDATE_BY" VARCHAR2(32),
    "UPDATER_ID" BIGINT,
    "UPDATE_TIME" DATETIME(6),
    "REMARK" VARCHAR2(512),
    NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DA_ASSET_VIDEO" IS '数据资产-视频数据表';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."ASSET_ID" IS '资产id';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."CONFIG" IS '配置JSON;海康：{"appKey":"xxx","appSecret":"xxx","cameraIndexCode":"监控点唯一标识"} 大华：{"username":"账号","password":"密码","channel":"通道号"}';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DA_ASSET_VIDEO"."ID" IS 'ID';
